/*
 * An example of Prolog being used as a database and query language at
 * the same time. Below is a part of the Unicode table represented with
 * binary relation code_name(?Code,?Name).
 *
 * Out of the box we can, for example, find a symbol by its code or 
 * symbols that share the same name:
 *
 * ?- code_name(Code,"COLON").
 * Code = 58.
 *
 * ?- dif(Code1, Code2), code_name(Code1,Name), code_name(Code2,Name).
 * Code1 = 0, Code2 = 1, Name = "<control>",
 * Code1 = 0, Code2 = 2, Name = "<control>",
 * ...
 *
 * In some Prolog implementations 'Name' may not look as you expected
 * being a list instead of a string: 
 * Name = ['<','c','o','n','r','o','l','>']
 *
 * In such cases concatenate a list back into string using
 * atomics_to_string/2.
 *
 * ?- dif(Code1, Code2),
 *    code_name(Code1,_Name),
 *    code_name(Code2,_Name),
 *    atomics_to_string(_Name, Name).
 *
 * Adding a little grammar (...) we are allowed not only search by a
 * name or a code, but also search by a search pattern. Let us, for
 * example, find all symbols with names starting with a word
 * "LATIN".
 *
 * ?- code_name(Code,_Name),
 *    phrase(("LATIN",...),_Name),
 *    atomics_to_string(_Name,Name).
 *
 * The next query returns us all symbols where "LATIN" is somewhere in a
 * middle of the name.
 *
 * ?- code_name(Code,_Name),
 *    phrase((...,[_],"LATIN",...),_Name),
 *    atomics_to_string(_Name,Name).
 *
 * Code = 867, Name="COMBINING LATIN SMALL LETTER A",
 * Code = 868, Name="COMBINING LATIN SMALL LETTER E",
 * ...
 *
 */

:- set_prolog_flag(double_quotes, chars).

... --> [] ; [_], ... .

